import React from 'react'
import '../../Styles/Components/floatIcons.scss'

const FloatIcons = () => {
    return (
        <>
            <div className='icons-container'>
                <i className="fa-brands fa-github"></i>
            </div>
        </>

    )
}

export default FloatIcons
